import React, { useState, useEffect } from 'react';
import { MessageCircle, ClipboardList, Sparkles, Zap } from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import './PlanSelection.css';
import Navbar from '../NavBar/Navbar';

const PlanSelection = () => {
  const navigate = useNavigate();
  const [hoveredSide, setHoveredSide] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  // Add event listener for mouse movement
  useEffect(() => {
    setIsLoaded(true);
    const handleMouseMove = (e) => setMousePosition({ x: e.clientX, y: e.clientY });

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  // Handle side click with ripple animation effect
  const handleSideClick = (route) => {
    const ripple = document.querySelector('.click-ripple');
    if (ripple) {
      ripple.style.left = `${mousePosition.x}px`;
      ripple.style.top = `${mousePosition.y}px`;
      ripple.classList.add('active');

      setTimeout(() => {
        ripple.classList.remove('active');
        navigate(route);
      }, 500);
    }
  };

  return (
    <div className={`plan-selection ${isLoaded ? 'loaded' : ''}`}>
      <Navbar />
      <div className="click-ripple" />
      <div className="diagonal-divider" />

      {/* Particles Animation */}
      {Array.from({ length: 20 }).map((_, i) => (
        <div 
          key={i} 
          className={`particle ${hoveredSide === 'left' ? 'particle-left' : ''} ${hoveredSide === 'right' ? 'particle-right' : ''}`}
          style={{
            '--delay': `${i * 0.1}s`,
            '--size': `${Math.random() * 10 + 5}px`,
            '--position-x': `${Math.random() * 100}%`,
            '--position-y': `${Math.random() * 100}%`,
          }}
        />
      ))}

      {/* Selection Sections */}
      <SelectionSide
        side="left"
        title="AI Chatbot"
        description="Get personalized recommendations through interactive chat"
        route="/MiloChatbot"
        iconMain={<MessageCircle className="main-icon" />}
        iconSecondary={<Sparkles className="secondary-icon" />}
        features={[
          { icon: <Zap size={16} />, text: "Smart Responses" },
          { icon: <MessageCircle size={16} />, text: "Natural Conversation" },
        ]}
        buttonText="Start Chat"
        hoveredSide={hoveredSide}
        setHoveredSide={setHoveredSide}
        handleSideClick={handleSideClick}
      />

      <SelectionSide
        side="right"
        title="Form Based"
        description="Quick and structured recommendation process"
        route="/form-plan"
        iconMain={<ClipboardList className="main-icon" />}
        //iconSecondary={<Sparkles className="secondary-icon" />}
        features={[
          { icon: <Zap size={16} />, text: "Instant Results" },
          { icon: <ClipboardList size={16} />, text: "Guided Process" },
        ]}
        buttonText="Start Form"
        hoveredSide={hoveredSide}
        setHoveredSide={setHoveredSide}
        handleSideClick={handleSideClick}
      />

      {/* Floating Elements */}
      <div className="floating-elements">
        {Array.from({ length: 6 }).map((_, i) => (
          <div 
            key={i}
            className={`floating-element ${hoveredSide === 'left' ? 'float-left' : ''} ${hoveredSide === 'right' ? 'float-right' : ''}`}
            style={{
              '--delay': `${i * 0.2}s`,
              '--scale': `${Math.random() * 0.5 + 0.5}`,
            }}
          />
        ))}
      </div>
    </div>
  );
};

// Reusable Selection Component
const SelectionSide = ({ side, title, description, route, iconMain, iconSecondary, features, buttonText, hoveredSide, setHoveredSide, handleSideClick }) => {
  return (
    <div 
      className={`side ${side} ${hoveredSide === side ? 'hovered' : ''}`}
      onMouseEnter={() => setHoveredSide(side)}
      onMouseLeave={() => setHoveredSide(null)}
      onClick={() => handleSideClick(route)}
    >
      <div className="content-wrapper">
        <div className="icon-wrapper">
          {iconMain}
          {iconSecondary}
        </div>
        <h2>{title}</h2>
        <p>{description}</p>
        <div className="features">
          {features.map((feature, index) => (
            <div key={index} className="feature">
              {feature.icon}
              <span>{feature.text}</span>
            </div>
          ))}
        </div>
        <button className="cta-button">{buttonText}</button>
      </div>
    </div>
  );
};

export default PlanSelection;
